import { Card } from 'antd'
import React from 'react'

const Main = () => {
  return (
    <div>
      <Card title={'記帳本'} bordered={true} style={{ borderBottom:'4px #666', alignItems:'left' }}>
        <p>Card content</p>
      </Card>
    </div>
  )
}

export default Main
